import React from "react";
import { Link } from "react-router-dom";
import Logo from "../assets/img/logo2.png";

import HouseList from "./HouseList";
import { housesData } from "../data";

const Header = () => {

  return (
    <header className="py-3 mb-3 border-b">
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/">
          <img src={Logo} alt="logo modulhome" />
        </Link>

        <div className="flex items-center gap-6">
          <Link 
            className=" hover:text-violet-600 transition " 
            to={`/property/${moduleHouse ? moduleHouse.id : ''}`}
            >
            Modules
          </Link>
          <Link
            className=" bg-violet-700 text-white hover:bg-violet-900 px-4 py-3 rounded-lg transition "
            to={`/property/${housesData.find((house) => house.category === "villa").id}`}
          >
            Villas
          </Link>
          <div>
            <HouseList />
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
